import React, { useEffect, useState } from 'react';
import classes from './CatalogCardElem.module.css';
import { useNavigate, useParams } from 'react-router-dom';
// import ProductPage from '../../Pages/ProductPage/ProductPage';
import {data} from '../../data/data';

type CatalogCardElem = {
    onClick?: () => void
}

export default function CatalogCardElem(props: CatalogCardElem) {
    const navigate = useNavigate();
    const {id} = useParams();
    const param = id?.slice(0, -1);
    const dataN = (data.filter((elem) => elem.nameLink == param)[0].pages);
    const titles:string[] = [];
    const nameLink:string[] = [];
    const img:string[] = [];
    dataN.forEach((elem) => {
        titles.push(elem.title);
        nameLink.push(elem.nameLink);
        if (elem.img) {
            img.push(elem.img);
        }
        
    });
    return (
        <main className={classes.catalog_forklift__container}>
            <h3>{(data.filter((elem) => elem.nameLink == param)[0].title)}</h3>
            <div className={classes.catalog_forklift_cards__container}>
                {titles.map((el, i)=> {
                    // return <ProductPage key = {id+1} onClick={() => navigate(`/${nameLink[id]}>`)}/>
                    return (
                        <div key = {el} className={classes.catalog_forklift_card} onClick={() => navigate(`/${(data.filter((elem) => elem.nameLink == param)[0].nameLink)}>`)}>
                            <span className={classes.catalog__card_title}>{el}</span>
                            <img src={img[id]} alt='Погрузчик' className={classes.catalog__card_img}/>
                        </div>
                    )
                    // <span key = {el} className={classes.catalog_forklift_card} onClick={() => navigate(`/${(data.filter((elem) => elem.nameLink == param)[0].nameLink)}/${nameLink[i]}>`)}>{el}</span>
                })}
            </div>
        </main>
  );
}
